<template>        <wangeditors                ref="wangeditorch"                :editorvalue="editorvalue"                :EditorImgUrl="EditorImgUrl"                :EditorVideoUrl="EditorVideoUrl"                :EditorHeight="EditorHeight"                :EditorZindex="EditorZindex"                v-on:getWangEditorValue=getWangEditorValue                v-on:getWangEditorimg=getWangEditorimg                v-on:getWangEditorvideo="getWangEditorvideo"        ></wangeditors></template><script lang="ts">    import {ref,defineComponent } from "vue";    import wangeditors from "./components/wangeditor.vue";    export default defineComponent({        name: 'wangeditor',        components:{wangeditors},        props:{            Editorhtml:String,            EditorImgUrl:String,            EditorVideoUrl:String,            EditorHeight:Number,            EditorZindex:Number        },        setup(props: any, content: any){             const editorvalue = props.Editorhtml;             const EditorImgUrl = props.EditorImgUrl;             const EditorVideoUrl = props.EditorVideoUrl;             const EditorHeight = props.EditorHeight;             const EditorZindex = props.EditorZindex;             const getWangEditorValue = (str:string) => {                 content.emit('EditorValueFn', str);             }             const getWangEditorimg = (str:string)=>{                 content.emit('getWangEditorimg', str);             }            const getWangEditorvideo = (str:string)=>{                content.emit('getWangEditorvideo', str);            }             const wangeditorch = ref();             return {                 getWangEditorValue,                 editorvalue,                 getWangEditorimg,                 getWangEditorvideo,                 EditorImgUrl,                 EditorVideoUrl,                 EditorHeight,                 EditorZindex             }         }    })</script><style scoped></style>